import { Col, Row, Form } from 'react-bootstrap'


const formStyle = {
  margin: '50px',
  textAlign: 'center'
  };

const textStyle = {

}

const inputStyle = {
  width: '100%'
}

const FlexForm = () => {
  return (
    <div style={formStyle}>
      <Form>
        <Form.Group as={Row} controlId="name">
          <Form.Label column sm="2">
            Name
          </Form.Label>
          <Col>
            <Form.Control plaintext />
          </Col>
        </Form.Group>
        <Form.Group as={Row} controlId="email">
          <Form.Label column sm="2">
            Email
          </Form.Label>
          <Col>
            <Form.Control plaintext />
          </Col>
        </Form.Group>
      </Form>
    </div>
  )
}

export default FlexForm
